package com.capbpm.react.util;

public class HttpHeader {
	public String name;
	public String value;

	public HttpHeader() {
	}

	public String getValue() {
		// TODO Auto-generated method stub
		return value;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public void setValue(String value) {
		this.value = value;
	}
}